    def process_data(self, port, change):
        print(f"포트 {port}: 변화량 {change} 추가됨")
        self.laser_changes[port].append(change)

        # 각 포트 데이터 길이 확인
        port_lengths = [len(self.laser_changes[i]) for i in range(4)]
        print(f"각 포트 데이터 길이: {port_lengths}")

        # 배치 사이즈 이상인지 확인
        batch_check = [len(self.laser_changes[i]) >= 1 for i in range(4)]
        print(f"배치 사이즈 이상 데이터 확인: {batch_check}")

        # 모든 포트에서 batch_size 이상 데이터 수집되었는지 확인
        if all(batch_check):
            # print("모든 포트에서 batch_size 이상 데이터 수집됨, 가중치 추정 시작")
            return self.select_weight_estimation_method()

    def select_weight_estimation_method(self):
        # laser_changes[0]과 laser_changes[2]에 값이 충분히 쌓였는지 확인
        if len(self.laser_changes[0]) > 0 and len(self.laser_changes[2]) > 0:
            mode_port1 = mode(self.laser_changes[0], keepdims=True).mode[0]
            print(f"COM9 데이터 상태: {self.laser_changes[0]}")
            mode_port3 = mode(self.laser_changes[2], keepdims=True).mode[0]
        else:
            mode_port1 = mode_port3 = 0

        print(f"Mode 값: port1={mode_port1}, port3={mode_port3}")  # 모드 값 출력

        # 카테고리 선택
        if mode_port1 > 0 and mode_port3 < 0 or mode_port1 > mode_port3:
            category = "left"
        elif mode_port1 > 0 and mode_port3 > 0:
            category = "mid"
        elif mode_port1 < 0 and mode_port3 > 0 or mode_port1 < mode_port3:
            category = "right"
        else:
            category = "mid"

        print(f"선택된 카테고리: {category}")
        return self.calculate_weight_estimation(category)

    def calculate_weight_estimation(self, category):
        if len(self.laser_changes[0]) > 0 and len(self.laser_changes[1]) > 0:
            left_change = (sum(self.laser_changes[0]) + sum(self.laser_changes[1])) / (
                        len(self.laser_changes[0]) + len(self.laser_changes[1]))
        else:
            left_change = 0

        if len(self.laser_changes[2]) > 0 and len(self.laser_changes[3]) > 0:
            right_change = (sum(self.laser_changes[2]) + sum(self.laser_changes[3])) / (
                        len(self.laser_changes[2]) + len(self.laser_changes[3]))
        else:
            right_change = 0

        if len(self.laser_changes[0]) > 0 and len(self.laser_changes[1]) > 0 and \
                len(self.laser_changes[2]) > 0 and len(self.laser_changes[3]) > 0:
            mid_change = (sum(self.laser_changes[0]) + sum(self.laser_changes[1]) + sum(self.laser_changes[2]) + sum(
                self.laser_changes[3])) / \
                         (len(self.laser_changes[0]) + len(self.laser_changes[1]) + len(self.laser_changes[2]) + len(
                             self.laser_changes[3]))
        else:
            mid_change = 0

        print(f"계산된 평균 변화량: left={left_change}, mid={mid_change}, right={right_change}")  # 평균 변화량 출력

        sensor_values = {"left": left_change, "right": right_change, "mid": mid_change}
        closest_indices = {}



        if category in sensor_values and sensor_values[category] != 0:
            if category in self.constants:  # 카테고리가 constants에 존재하는지 확인
                closest_value = min(self.constants[category], key=lambda x: abs(x - sensor_values[category]))
                closest_indices[category] = self.constants[category].index(closest_value)
            else:
                closest_indices[category] = None  # 만약 category가 constants에 없으면 None 처리
        else:
            closest_indices[category] = None  # category 값이 0일 경우 처리 안함

        print(f"가장 가까운 인덱스: {closest_indices}")  # 매핑된 인덱스 출력

        return closest_indices
